import React from 'react';
import { SocialIcon } from 'react-social-icons';

class SocialBar extends React.Component {
    render() {
        return (
            <div id='social-bar' className='flex justify-center'>
                <SocialIcon url='https://www.facebook.com/christopher.n.reeves' />
                <SocialIcon url='https://www.instagram.com/reev_o/?hl=en' />
                <SocialIcon url='https://www.google.com/+ChristopherNicholasReeves' />
                <SocialIcon url='https://www.linkedin.com/in/christopher-n-reeves/' />
                <SocialIcon url='https://github.com/TheZenDev89' />
            </div>
        )
    }
}

export default SocialBar;
